      <GoogleMapReact
        bootstrapURLKeys={{ key: "AIzaSyCPRKHpyE1gFkg31fWaQDXOouDa-0sTxUE" }}
        defaultCenter={coordinates}
        center={coordinates}
        defaultZoom={14}
        margin={[50, 50, 50, 50]}
        options={""}
        onChange={(e) => {
          console.log(e);

          setCoordinates({ lat: e.center.lat, lng: e.center.lng });
        }}
        onChildClick={""}
      ></GoogleMapReact>
    </div>
  );
};
export default Map;
